                    break;
                case Hair_FieldIndex.Model:
                    this.Model = (MaskItem<Exception, Model_ErrorMask>)obj;
                    break;
                case Hair_FieldIndex.Icon:
                    this.Icon = (Exception)obj;
                    break;
                case Hair_FieldIndex.Flags:
                    this.Flags = (Exception)obj;
                    break;
                default:
                    base.SetNthMask(index, obj);
                    break;
            }
